import React from 'react';

const Resume = () => {
  return (
    <div style={{ height: '100vh', width: '100%' }}>
      <iframe
        src="/About-Me/Piran Aminullah Resume.pdf"
        style={{ height: '100%', width: '100%', border: 'none' }}
        title="Piran Aminullah Resume"
      ></iframe>
    </div>
  );
};

export default Resume;
